import React from 'react';
import * as I from './styled'

function ImagemButton(props) {
    return (
        <I.ImageButtonContainer>
            <I.Image src={ props.imagem }/>
            <p>{ props.texto }</p>
            <a href={'https://github.com/laisrm'}>Github</a> 
        </I.ImageButtonContainer>

    )
}

export default ImagemButton;
